import React from "react";
import { Button as RebassButton } from "rebass";
import { buttonTheme } from "../theme";

const Button = ({ variant, onClick, children, otherProps }) => {
  return (
    <RebassButton
      variant={variant}
      theme={buttonTheme}
      onClick={onClick}
      {...otherProps}
    >
      {children}
    </RebassButton>
  );
};

export default Button;
